Given that $o(n) = -n^2 - 2n + 11$ and $s = o(0)$, solve the following system of equations for $b$:

\[
\begin{align*}
5b - f - s &= 0, \\
5b + 4f - 4 &= 2.
\end{align*}
\]

In LaTeX format, the question can be written as:

\begin{align*}
\intertext{Given the function $o(n) = -n^2 - 2n + 11$ and $s = o(0)$, solve the system of equations:}
5b - f - s &= 0, \\
5b + 4f - 4 &= 2.
\intertext{for the variable $b$.}
\end{align*}

Note: The hint provided in the original question is not necessary to solve the system of equations. It is just an additional information that $b = 1$ is the solution.

